import { FontAwesomeIcon } from "@fortawesome/react-fontawesome";
const Project = () => {
  return (
    <div id="projects">
      <h4 className="text-lg text-center md:ml-30">Projects I have Done</h4>
      <div className="text-center grid grid-cols-1 hd gap-3 sm:ml-8 sm:mt-10 md:grid-cols-3 md:ml-70 sm:grid-cols-2 col-">
        <div className="border-2 w-90 ml-19 border-500 hover:border-t-4 drop-shadow-md">
          <h2>Android App</h2>
          <p>A blood group searching and donour app in your city</p>
          <p>This app was made with Java as Backend and XMl fronend</p>
        </div>
        <div className="border-2 border-500 hover:border-t-4 drop-shadow-md hover:drop-shadow-md">
          <h2>Android App</h2>
          <p>A blood group searching and donour app in your city</p>
          <p>This app was made with Java as Backend and XMl fronend</p>
        </div>
        <div className="border-2 border-500 hover:border-t-4 drop-shadow-md hover:drop-shadow-md">
          <h2>Android App</h2>
          <p>A blood group searching and donour app in your city</p>
          <p>This app was made with Java as Backend and XMl fronend</p>
        </div>
      </div>
    </div>
  );
};
export default Project;
